import React from 'react';
import useCustomHooks from './CustomHook';


function App(){

    const H = useCustomHooks()

    return(
        <>
        <h1>the count is { H.count }</h1>
        <button onClick={H.incriment}>incriment</button>
        </>
    )
}

export default App
